import React from 'react';
import './content-homepage.styles.css';
import {
  Layout, Input, Row, Col, Divider,
} from 'antd';
import CardItem from '../card-item/card-item.component';
import CarouselHomePage from '../carousel-homepage/carousel-homepage.component';

const { Content } = Layout;
const { Search } = Input;

const ContentHomePage = () => (
  <Layout style={{ padding: '0 24px 24px' }}>
    <Search
      placeholder="Search Category"
      enterButton
      size="large"
      style={{ marginBottom: '20px' }}
    />
    <Content
      className="site-layout-background"
      style={{
        padding: 24,
        margin: 0,
        minHeight: 600,
      }}
    >
      <Divider orientation="left">View Sale</Divider>
      <CarouselHomePage />
      <Divider orientation="left">Best Sales</Divider>
      <Row gutter={{
        xs: 8, sm: 16, md: 24, lg: 32,
      }}
      >
        <Col xs={24} sm={12} md={6} className="gutter-row" span={6}>
          <CardItem />
        </Col>
        <Col xs={24} sm={12} md={6} className="gutter-row" span={6}>
          <CardItem />
        </Col>
        <Col xs={24} sm={12} md={6} className="gutter-row" span={6}>
          <CardItem />
        </Col>
        <Col xs={24} sm={12} md={6} className="gutter-row" span={6}>
          <CardItem />
        </Col>

      </Row>
    </Content>
  </Layout>
);

export default ContentHomePage;
